INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (1, 'Отель Тис', 'Улица Чкалова 62', 'К услугам гостей этого отеля в стиле виллы, расположенного в городе Краснодар на реке Кубань, бесплатный Wi-Fi, номера с кондиционером и круглосуточная стойка регистрации', 1, 1, '688369000');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (2, 'D Hotel', 'улица Максима Горького , дом 213', 'Трехзвездочный отель D расположен в Краснодаре, в 2,7 км от памятника «Шурик» и района Лидочка и в 7 км от стадиона футбольного клуба «Краснодар». В этом 3-звездочном отеле предоставляются услуги консьержа и камеры хранения багажа', 2, 2, '0');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (3, 'Телеграф', 'ул. Рашпилевская 106 к1', 'Хостел «Телеграф» расположен в Краснодаре, менее чем в 1 км от памятника «Шурик» и Лидочка. К услугам гостей номера с кондиционером и общий лаундж.', 3, 3, '3.9777');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (4, 'Апартаменты на Красной 176', 'Красная 176 литер 1/3', 'Во всех апартаментах есть кондиционер, собственная ванная комната и кухня с микроволновой печью, холодильником, духовкой и плитой.Каждое утро в апартаментах сервируется полный английский/ирландский завтрак.', 4, 4, '4132620');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (5, 'Marton PALACE Krasnodar', '70 Ulitsa Mira', 'Отель Marton Palace Краснодар расположен в Краснодаре, в 3,6 км от памятника «Шурик» и района Лидчка. К услугам гостей бар, бесплатная частная парковка и общий лаундж.', 5, 5, '14');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (6, 'Marton San Remo Krasnodar', 'Tikhoretskaya Ulitsa 43', 'Отель «Сан Ремо» находится в 9 км от международного аэропорта Краснодара. На территории есть крытый бассейн и ресторан.', 6, 6, '49801000');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (7, 'B&B Hotel Centre', 'Улица Базовская 113', 'Отель типа «постель и завтрак» «Центр» расположен в Краснодаре, в 8 км от выставочного центра «КраснодарЭКСПО». К услугам гостей номера с кондиционером и бесплатная частная парковка на территории', 7, 7, '0');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (8, 'Отель Суворов', 'Улица Суворова, 107', 'Трехзвездочный отель «Суворов» расположен в Краснодаре. В распоряжении гостей столовая, круглосуточная стойка регистрации, камера хранения багажа и бесплатный Wi-Fi на всей территории', 8, 8, '435980000');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (9, 'Атлас Отель', 'Проезд Ломоносова 8', 'Отель «Атлас» с кафетерием и бесплатным Wi-Fi на всей территории расположен в Краснодаре в 2,7 км от стадиона ФК «Краснодар» и в 4 км от парка «Краснодар». ', 9, 9, '51561000');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (10, 'Гостевой дом Семья', 'Ulitsa Dlinnaya 12', 'Гостевой дом «Семейный» расположен в Краснодаре, в 2,2 км от памятника «Шурик» и района Лидочка и в 8 км от стадиона футбольного клуба «Краснодар». К услугам гостей принадлежности для барбекю и бесплатная частная парковка', 10, 10, '8712300');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (11, 'Апартаменты в самом Центре Краснодара у ТРЦ "Галлерея"', 'Октябрьская улица, дом 181/2', 'Апартаменты «В самом центре Краснодара у ТРЦ "Галерея"» с балконом и видом на город расположены примерно в 7 км от стадиона ФК «Краснодар». ', 11, 1, '0');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (12, 'Отель Западный', 'улица Рашпилевская 301', 'Отель «Западный», открытый в 2013 году, расположен в центре Краснодара, в 10 минутах ходьбы от главной улицы Красной.', 12, 2, '19.7');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (13, 'Отель Vista', 'Памирская 11', 'Отель Vista расположен в Краснодаре, в 5 км от стадиона футбольного клуба «Краснодар». К услугам гостей номера с кондиционером и общий лаундж', 13, 3, '7607970');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (14, 'Hostel on Kostyleva', 'Ulitsa Kostyleva 72', 'Хостел «На Костылева» расположен в Краснодаре, в 2,4 км от памятника Шри-Шурик и Лидочка и в 6 км от стадиона футбольного клуба «Краснодар». ', 14, 4, '19689.2');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (15, 'Villa Marton Krasnodar', 'Tikhoretskaya Street 45', 'Отель Villa Marton находится в Краснодаре. К услугам гостей сауна, массаж и бильярд. Предоставляется бесплатный WiFi и бесплатная парковка.', 15, 5, '1');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (16, 'Crystal Palace', 'Krasnykh Partizan 228', 'Этот отель расположен в 200 м от центра Краснодара. Отель Crystal Palace располагает бесплатным Wi-Fi и бесплатной парковкой. Все номера красочно оформлены в индустриальном стиле', 16, 6, '192457000');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (17, 'Гостевой дом АнгелА', 'Улица Братьев Игнатовых 167', 'Гостевой дом Angela расположен в Краснодаре, в 10 км от спортивно-концертного комплекса «Баскет Холл Арена» и в 1,8 км от ботанического сада Профессор Или. Косенко', 17, 7, '598.94');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (18, 'Героя Сарабеева 5/4', 'улица Героя Сарабеева', 'Апартаменты «Героя Сарабеева 5/4» с кондиционером и балконом расположены в Краснодаре, в 2,9 км от футбольного стадиона «Краснодар» и в 7 км от памятника Шурику и Лидочке', 18, 8, '88.9431');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (19, 'Отель Хемингуэй ', 'Улица Энергетиков 5', 'Отель «Хемингуэй» с кафе и бесплатным Wi-Fi на всей территории расположен в Краснодаре, в 8 км от выставочного центра «КраснодарЭКСПО».', 19, 9, '757.01');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (20, 'Bla Bla Rooms', 'ulitsa Rashpilevskaya 106', 'Хостел Bla Bla Rooms расположен в Краснодаре, в 1,2 км от памятника «Шурик» и района Лидочка. К услугам гостей номера с общим лаунджем и частная парковка', 20, 10, '283054000');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (21, 'Отель Аурелиу', 'Улица Пашковская 124', 'Гостиница "Аурелиу" расположена в самом центре города Краснодара, всего в 300 метрах от трамвайной остановки с 5 трамвайными маршрутами', 1, 1, '8819.66');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (22, 'Проф Отель', 'Улица Северная 129', 'Отель «Проф» расположен в центре города Краснодар, в 1 км от Ботанического сада имени Косенко. Стойка регистрации открыта круглосуточно', 2, 2, '1210500');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (23, 'Krasnodar Marriott Hotel', 'ул. Красная, 120', 'Отель Krasnodar Marriott с баром расположен в Краснодаре в Краснодарском крае, в 1,1 км от памятника Шурику и Лидочке и в 7 км от стадиона ФК «Краснодар»', 3, 3, '47114200');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (24, 'Евро двушка Восточно-Кругликовская 30/2', 'улица Восточно-Кругликовская 30/2 кв 241 ', 'Апартаменты «Евро двушка Восточно-Кругликовская 30/2» расположены в Краснодаре, в 1,2 км от стадиона ФК «Краснодар», в 6 км от памятника Шурику и Лидочке и в 11 км от торгового центра «Красная площадь»', 4, 4, '17180');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (25, 'Арт Отель', 'ул Леваневского 156/1', 'Этот отель расположен в деловом и культурном районе Кубан, в 5 минутах ходьбы от главной улицы Красной.', 5, 5, '2523250');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (26, 'Park of Krasnodar apartments on Panorama', 'ул. им. Героя Сарабеева, д. 5, корп. 1', 'Апартаменты «Парк Краснодар на Панорама» расположены в 4 км от стадиона «ФК «Краснодар». К услугам гостей фитнес-центр, бар и апартаменты с кондиционером', 6, 6, '0');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (27, 'Гостиница Tip Top', 'Улица Ковтюха 208, Краснодар', 'Отель «Тип Топ» находится в Краснодаре, в 10 минутах ходьбы от Кубанского государственного университета и остановки общественного транспорта «КубГУ»', 7, 7, '57864000');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (28, 'Apartment on Moskovskaya 118/2', 'Московская 118/2,', 'Апартаменты «На Московской 118/2» расположены в Краснодаре, в 6 км от памятника «Шурик» и города Лидочка и в 7 км от стадиона «Баскет Холл Арена». ', 8, 8, '13.8485');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (29, 'Golden Tulip Krasnodar', 'улица Суворова 91', 'Отель Golden Tulip Krasnodar расположен в центре Краснодара. К услугам гостей фитнес-центр, бар, общий лаундж, круглосуточная стойка регистрации и бесплатный Wi-Fi', 9, 9, '139');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (30, 'Marton Amigo Krasnodar', 'Ulitsa Rossiyskaya 61/1', 'Отель «Амиго» находится в центре Краснодара, рядом с Первомайским парком. К услугам гостей гидромассажная ванна, сауна, бар, бесплатная частная парковка на территории', 10, 10, '290188');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (31, 'Апартаменты на улице Красная 176', '176 улица Красная', 'Апартаменты «На улице Красная 176» с кондиционером, балконом и рестораном на территории расположены в 700 метрах от памятника Шурику и Лидочке', 11, 1, '11.7808');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (32, 'Апартаменты Галерея рядом с Marriott', 'Oktyabrskaya ulitsa 181', 'Апартаменты Central расположены менее чем в 1 км от памятника «Шурик» и района Лидочка. К услугам гостей отеля Marriott ресторан, а также номера с кондиционером, балконом и бесплатным Wi-Fi', 12, 2, '760314000');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (33, 'Art Villa & SPA', 'Ulitsa Lavrova 73', 'Отель «Арт Вилла» расположен напротив торгового центра OZ, в 5 минутах езды от международного аэропорта Краснодара. К услугам гостей бесплатная частная парковка', 13, 3, '46258.8');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (34, 'Апартаменты на ул. Красная В ЖК "Большой"', 'ул. Красная, д. 176', 'Апартаменты «На ул. Красная В ЖК “Большой”» с видом на город, рестораном и круглосуточной стойкой регистрации расположены в Краснодаре. В числе удобств бесплатный Wi-Fi', 14, 4, '0');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (35, 'Отель Круиз', 'улица Фадеева 328', 'Этот отель расположен всего в 3 минутах езды от международного аэропорта Пашковский в Краснодаре', 15, 5, '26597.9');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (36, 'Hilton Garden Inn Krasnodar', 'Красная Улица 25/2', 'Отель Hilton Garden Inn Krasnodar находится в самом центре Краснодара, на Красной улице. К услугам гостей бесплатный Wi-Fi, фитнес-центр и круглосуточная стойка регистрации', 16, 6, '28.1487');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (37, 'Апартаменты London', 'Ulitsa Rossiyskaya 369 A', 'Гостевой дом «Лондон» расположен в Краснодаре, в 5 км от стадиона «Баскет-Холл-Арена». К услугам гостей бар, бесплатная частная парковка, сад и терраса', 17, 7, '62.93');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (38, 'Mari Inn', '15 Ulitsa Dimitrova', 'Отель Mari Inn расположен в Краснодаре, в 8 км от стадиона «ФК Краснодар» и памятника «Шурик» и «Лидочка». К услугам гостей ресторан, круглосуточная стойка регистрации и бесплатный Wi-Fi', 18, 8, '72277');
INSERT INTO `hotel` (`id`, `name`, `adress`, `description`, `numbers_id`, `services_type_id`, `rating`) VALUES (39, 'Apartments on Krasnaya 176', '176 Krasnaya ulitsa, kv.615', 'Апартаменты «На Красной, 176» расположены в Краснодаре, в 800 м от памятника «Шурик» и района Лидочка и в 7 км от торгового центра Red Square.', 19, 9, '141388000');
